

def solution(nums, target):
    hash_size = len(nums)
    hash_table = [None] * hash_size
    
    for i,n in enumerate(nums):
        hash_key = abs(n) % hash_size
        
        if hash_table[hash_key] is None:
            hash_table[hash_key] = [[n, i]]
        else:
            hash_table[hash_key].append([n, i])

    for i,n in enumerate(nums):
        target_n = abs(target - n) % hash_size
        if hash_table[target_n] is not None:
            for e in hash_table[target_n]:
                if e[0] == target - n and e[1] != i:
                    return print([i, e[1]])

